import React from 'react';
import axios from 'axios';
import { withRouter } from 'react-router-dom';

const MyProfile = ({UserData}) => {

    return (
        <div>
            <img src={UserData.image}></img>
        </div>
    )
}

export default withRouter(MyProfile);
